import './App.css';
import TextBox from "./TextBox";
import React, {useState} from 'react';
import axios from 'axios';
import { AwesomeButton } from "react-awesome-button";
import "react-awesome-button/dist/styles.css";

function Route() {
    const [startLat, setStartLat] = useState(0);
    const [startLon, setStartLon] = useState(0);
    const [destLat, setDestLat] = useState(0);
    const [destLon, setDestLon] = useState(0);
    const [route, setRoute] = useState([]);

    /**
     * Makes an axios request.
     */
    const requestRoute = () => {
        const toSend = {
            srclat: startLat,
            srclong: startLon,
            destlat: destLat,
            destlong: destLon
        };
        //console.log(toSend);

        let config = {
            headers: {
                "Content-Type": "application/json",
                'Access-Control-Allow-Origin': '*',
            }
        }

        //Install and import this!
        axios.post(
            "http://localhost:4567/route",
            toSend,
            config
        )
            .then(response => {
                console.log(response.data);
                // TODO: make sure that the "route" here corresponds to the correct data we want back
                setRoute(response.data["route"]);
            })
            .catch(function (error) {
                console.log(error);
            });
    }

    return (
        <div>
            <h1>Test title</h1>
            <TextBox label={"Source Latitude"} change={setStartLat}/>
            <TextBox label={"Source Longitude"} change={setStartLon}/>
            <TextBox label={"Destination Latitude"} change={setDestLat}/>
            <TextBox label={"Destination Longitude"} change={setDestLon}/>
            <AwesomeButton type="primary" onPress={requestRoute}>Submit!</AwesomeButton>
            {route.map((coord, index) =>
                <p key={index}>{coord[0]}, {coord[1]}</p>
            )}
        </div>
    );
}

export default Route;
